import React from 'react';
import './Botnav.css'

import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import {
    faFacebookF,
    faGithub,
    faFacebookMessenger,
    faLinkedin,
    faFedora
} from '@fortawesome/free-brands-svg-icons';

const Botnav = () => {
    return (
        <header className='botnav'>
            <nav className='botnav__nav'>
                <div className='botnav__nav-spacer'></div>
                <div className='botnav__nav-links'>
                    <FontAwesomeIcon href="https://google.com" icon={faFacebookF}/>
                    <FontAwesomeIcon icon={faGithub}/>
                    <FontAwesomeIcon icon={faLinkedin}/>
                    <FontAwesomeIcon icon={faFacebookMessenger}/>
                    <FontAwesomeIcon icon={faFedora}/>

                    
                </div>
                <div className='botnav__nav-spacer'></div>
            </nav>
        </header>
        
    );
}

export default Botnav;
